import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import LoginUserPage from './LoginUserPage';
import HomePage from './HomePage';
import LoginAdminPage from './LoginAdminPage';
import AdminCRUDBanners from './AdminCRUDBanners';
import SamSung from './Samsaung';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [userAuthenticated, setUserAuthenticated] = useState(false);
  const [adminAuthenticated, setAdminAuthenticated] = useState(false);

  const handleUserLogin = () => {
    setUserAuthenticated(true);
  };

  const handleAdminLogin = () => {
    setAdminAuthenticated(true);
  };

  return (
    <Router>
      <Switch>
        <Route path="/userlogin">
          {userAuthenticated ? <Redirect to="/homepage" /> : <LoginUserPage onLogin={handleUserLogin} />}
        </Route>
        <Route path="/homepage">
          {userAuthenticated ? <HomePage /> : <Redirect to="/userlogin" />}
        </Route>
        <Route path="/adminlogin">
          {adminAuthenticated ? <Redirect to="/homepage" /> : <LoginAdminPage AdminonLogin={handleAdminLogin} />}
        </Route>
        <Route path="/adminpage">
          {adminAuthenticated ? <AdminCRUDBanners /> : <Redirect to="/adminlogin" />}
        </Route>
        <Route path="/Samsung">
          {adminAuthenticated ? <SamSung /> : <Redirect to="/adminlogin" />}
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
